starry-next 是对 ArceOS 的扩展。依据 Plugin 的设计，它作为 ArceOS 的一个应用（这里我们称为 内核应用 ）开始运行。对应在 Makefile 下的执行逻辑是： AX_ROOT ?= $(PWD)/.arceos
# Makefile under starry-next folders
build run justrun debug disasm: ax_root @make -C $(AX_ROOT) A=$(PWD) FEATURES=$(FEATURES) $@ 这里可以看到它通过 -C $(AX_ROOT) 指定了调用 ArceOS 的 Makefile，并制定运行的内核应用为当前目录，即 starry-next。 查看 starry-next 的 Cargo.toml 文件如下： [dependencies]
log = "0.4"
linkme = "0.3"
axerrno = "0.1"
memory_addr = "0.3"
xmas-elf = "0.9"
bitflags = "2.6"
kernel-elf-parser = "0.1.0"
num_enum = { version = "0.7", default-features = false }
syscalls = { version = "0.6", default-features = false } axstd = { git = "https://github.com/arceos-org/arceos.git", branch = "monolithic", features = ["paging"] }
axhal = { git = "https://github.com/arceos-org/arceos.git", branch = "monolithic", features = ["uspace"] }
axmm = { git = "https://github.com/arceos-org/arceos.git", branch = "monolithic" }
axtask = { git = "https://github.com/arceos-org/arceos.git", branch = "monolithic" }
axsync = { git = "https://github.com/arceos-org/arceos.git", branch = "monolithic" }
axruntime = { git = "https://github.com/arceos-org/arceos.git", branch = "monolithic", features = ["multitask"] }
arceos_posix_api = { git = "https://github.com/arceos-org/arceos.git", branch = "monolithic" } [target.'cfg(target_arch = "x86_64")'.dependencies]
x86 = "0.52" [build-dependencies]
toml_edit = "0.22" 由于目前宏内核实现仍然未合入主线，因此我们手动指定了 monolithic 分支。 这里比较重要的是对于 axhal 启动了 uspace feature, axhal 模块中标注了 uspace feature 的实现可以看到，它包含如下内容： UspaceContext 实现，包含了用户态上下文的定义与进入用户态的初始化代码 Syscall trap 接收与转发 User trap and exit 实现 当添加了这些必要内容之后，我们就对 Unikernel 提供的 Task 结构添加了进入用户态的能力。在 src/task.rs 下我们调用 spawn_user_task 的时候，就可以创建一个即将进入用户态、运行用户应用的任务了。 pub fn spawn_user_task(aspace: Arc<Mutex<AddrSpace>>, uctx: UspaceContext) -> AxTaskRef { let mut task = TaskInner::new( || { let curr = axtask::current(); let kstack_top = curr.kernel_stack_top().unwrap(); // 设置任务上下文，让任务在开始被调度之后尝试进入用户态 unsafe { curr.task_ext().uctx.enter_uspace(kstack_top) }; }, "userboot".into(), crate::config::KERNEL_STACK_SIZE, ); task.ctx_mut() .set_page_table_root(aspace.lock().page_table_root()); task.init_task_ext(TaskExt::new(uctx, aspace)); axtask::spawn_task(task)
} 按照这个思路，我们可以做到在最小化添加 uspace feature 的情况下，实现宏内核的功能扩展。Unikernel 已有的任务调度、文件系统、网络栈等服务都可以直接被宏内核所复用。此后只需要根据 POSIX syscall 标准，在上层的内核应用中实现对应的系统调用，即可适配更多的应用。

