在 ArceOS 已经实现了一些 syscall，例如 sys_clock_gettime，sys_yield 等。这类接口在宏内核和 Unikernel 中的语义和实现都基本一致，因此我们可以直接复用这些 syscall 的实现，而不用重新实现一遍。 use arceos_posix_api as api; pub(crate) fn sys_clock_gettime(clock_id: i32, tp: *mut api::ctypes::timespec) -> i32 { unsafe { api::sys_clock_gettime(clock_id, tp) }
} pub(crate) fn sys_sched_yield() -> i32 { api::sys_sched_yield()
}

