宏内核中常常需要对调用的 syscall 进行检查，例如检查参数是否合法，是否有权限等。这些检查在 Unikernel 中是不需要的。另外宏内核中每一个 syscall 的功能可能会更加丰富，涉及更多可选参数。此时我们需要将 Unikernel 已有的功能当作底层的实现，并为其封装满足 POSIX 接口的检查和其他可选实现。 本章节涉及的 syscall 和文档如下： arch_prctl mmap clock_nanosleep 以下为 clock_nanosleep 和 arch_prctl syscall 的实现。其中 arch_prctl 通过解析用户传来的参数，并且选择性调用内核 axhal 提供的功能完成实现，从而 避免在上层引入硬件层相关的代码，让上层能够尽可能做好抽象和隔离 。 pub(crate) fn sys_clock_nanosleep( clock_id: clockid_t, flags: isize, req: *const timespec, rem: *mut timespec,
) -> i32 { // CLOCK defaults to CLOCK_REALTIME // flags defaults to 0 if clock_id != api::ctypes::CLOCK_REALTIME as clockid_t { // For older linux headers, it does not define ENOTSUP, so we use EOPNOTSUPP instead return -LinuxError::EOPNOTSUPP.code(); } if flags != 0 { return -LinuxError::EOPNOTSUPP.code(); } unsafe { api::sys_nanosleep(req, rem) }
} #[cfg(target_arch = "x86_64")]
pub(crate) fn sys_arch_prctl(code: i32, addr: u64) -> isize { use axerrno::LinuxError; syscall_body!(sys_arch_prctl, { match ArchPrctlCode::try_from(code) { // TODO: check the legality of the address Ok(ArchPrctlCode::SetFs) => { unsafe { axhal::arch::write_thread_pointer(addr as usize); } Ok(0) } Ok(ArchPrctlCode::GetFs) => { unsafe { *(addr as *mut u64) = axhal::arch::read_thread_pointer() as u64; } Ok(0) } Ok(ArchPrctlCode::SetGs) => { unsafe { x86::msr::wrmsr(x86::msr::IA32_KERNEL_GSBASE, addr); } Ok(0) } Ok(ArchPrctlCode::GetGs) => { unsafe { *(addr as *mut u64) = x86::msr::rdmsr(x86::msr::IA32_KERNEL_GSBASE); } Ok(0) } _ => Err(LinuxError::ENOSYS), } })
} 另一个例子是 mmap syscall，它的功能相当强大且复杂，底层 axmm 模块仅提供了最简功能，由开发者在上层自行实现与完善。我们需要根据 mmap 的各种 flags 来实现不同的功能，例如 MAP_FIXED，MAP_PRIVATE 等。以下是 mmap syscall 的一个示例实现。 pub(crate) fn sys_mmap( addr: *mut usize, length: usize, prot: i32, flags: i32, _fd: i32, _offset: isize,
) -> usize { syscall_body!(sys_mmap, { let curr = current(); let curr_ext = curr.task_ext(); let mut aspace = curr_ext.aspace.lock(); let permission_flags = MmapProt::from_bits_truncate(prot); // TODO: check illegal flags for mmap // An example is the flags contained none of MAP_PRIVATE, MAP_SHARED, or MAP_SHARED_VALIDATE. let map_flags = MmapFlags::from_bits_truncate(flags); let start_addr = if map_flags.contains(MmapFlags::MAP_FIXED) { VirtAddr::from(addr as usize) } else { aspace .find_free_area( VirtAddr::from(addr as usize), length, VirtAddrRange::new(aspace.base(), aspace.end()), ) .or(aspace.find_free_area( aspace.base(), length, VirtAddrRange::new(aspace.base(), aspace.end()), )) .ok_or(LinuxError::ENOMEM)? }; aspace.map_alloc(start_addr, length, permission_flags.into(), false)?; Ok(start_addr.as_usize()) })
} 我们的示例也仅仅实现了标准的 mmap 功能，对于 mmap 的更多功能，例如 MAP_SHARED 等，需要进一步完善。
